import './App.css';
import Link from './Components/Link';
import ApplicantLogin from './Pages/ApplicantLogin';
import ConfirmExam from './Pages/ConfirmExam';
import Route from './Components/Route';
import { useDispatch } from 'react-redux';
import { loadPath, LOGIN_PATH } from './store';
import { useEffect } from 'react';
import { useNavigate } from './Hooks/use-navigate-to';

function App() {

  const dispatch = useDispatch();
  useEffect(() =>
  {
    start();

    const handler = (event) =>
    {
      console.log(window.history.length);
      dispatch(loadPath(window.location.pathname));
    }
    window.addEventListener('popstate', handler);
    return () =>
    {
        window.removeEventListener('popstate', handler)
    }
  }, []);

  const Start = ()=>
  {
    useNavigate(LOGIN_PATH);
    //dispatch(loadPath(LOGIN_PATH));
  }

  return (
    <div className="">
      <header className="App-header">
        <h1>Interview Hub</h1>
      </header>
      <Route path={"/applicantLogin"}>
        <ApplicantLogin/></Route>
      <Route path={"/confirmExam"}>
        <ConfirmExam/></Route>
    </div> 
  );
}

export default App;
